INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 10, 11300103, 1, 8, 3001, 1, "vo_minigame_1012_result_1002", 10, 1, 5.41, "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！", 10);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (8, 10, 11300104, 1, 5, 3001, 1, "vo_minigame_1012_result_1003", 10, 2, 8.11, "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！", 10);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (5, 0, 11300105, 1, 10, 3001, 1, "vo_minigame_1012_result_1004", 10, 2, 1.31, "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！", 10);
