INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300150, 1, 3, 3001, 2, "vo_minigame_1012_result_1082", 9, 2, 2.46, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 5);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300151, 1, 3, 3001, 2, "vo_minigame_1012_result_1083", 9, 2, 2.94, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 5);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300152, 1, 7, 3001, 2, "vo_minigame_1012_result_1084", 9, 3, 4.19, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 5);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300153, 1, 1, 3001, 2, "vo_minigame_1012_result_1085", 9, 3, 0.0, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 5);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300154, 1, 3, 3001, 2, "vo_minigame_1012_result_1086", 9, 3, 2.63, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 5);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300155, 1, 3, 3001, 2, "vo_minigame_1012_result_1087", 4, 1, 5.53, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 9, 12300156, 1, 3, 3001, 2, "vo_minigame_1012_result_1088", 4, 1, 0.01, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 3, 12300157, 1, 3, 3001, 2, "vo_minigame_1012_result_1089", 4, 1, 4.15, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 9, 12300158, 1, 9, 3001, 2, "vo_minigame_1012_result_1090", 4, 2, 0.01, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300159, 1, 3, 3001, 2, "vo_minigame_1012_result_1091", 4, 2, 5.37, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300160, 1, 3, 3001, 2, "vo_minigame_1012_result_1092", 4, 2, 1.44, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 0, 12300161, 1, 3, 3001, 2, "vo_minigame_1012_result_1093", 4, 3, 0.0, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 3, 12300162, 1, 3, 3001, 2, "vo_minigame_1012_result_1094", 4, 3, 2.91, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (1, 0, 12300163, 1, 5, 3001, 2, "vo_minigame_1012_result_1095", 4, 3, 2.61, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 1);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 12300164, 1, 4, 3001, 2, "vo_minigame_1012_result_1096", 0, 1, 3.63, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 12300165, 1, 6, 3001, 2, "vo_minigame_1012_result_1097", 0, 1, 4.16, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 6, 12300166, 1, 3, 3001, 2, "vo_minigame_1012_result_1098", 0, 1, 0.01, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 0, 12300167, 1, 6, 3001, 2, "vo_minigame_1012_result_1099", 0, 2, 5.75, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (2, 1, 12300168, 1, 4, 3001, 2, "vo_minigame_1012_result_1100", 0, 2, 5.64, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (4, 8, 12300169, 1, 8, 3001, 2, "vo_minigame_1012_result_1101", 0, 2, 5.73, "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (3, 1, 12300170, 1, 5, 3001, 2, "vo_minigame_1012_result_1102", 0, 3, 5.32, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 0);
INSERT INTO `v1_4455cfba25e6491818dcd944bb57a86c5e42ca15f9993ac1c7b0881534824409` VALUES (9, 9, 12300171, 1, 3, 3001, 2, "vo_minigame_1012_result_1103", 0, 3, 2.37, "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！", 0);
